webpackJsonp([0xf3cda2320fe2],{528:function(e,s){e.exports={data:{site:{siteMetadata:{startDate:"2018-06-06",lessons:8,noClass:[4]}},markdownRemark:{html:'<h2>Linking to a file in the same folder</h2>\n<p>If the two files are in the same folder than file 1 can call file 2 by the file name only.</p>\n<p><img src="/pages/2/images/image01.png"></p>\n<h3>Example</h3>\n<p><code class="language-text">&lt;a href=”file2.html”&gt;link&lt;/a&gt;</code>\n<code class="language-text">&lt;img src=”file2.gif” alt=””&gt;</code></p>\n<h2>Linking to a file in a sub folder</h2>\n<p>If the file you wish to link to is a sub folder you can not link to the file directly. Instead you need declare the folder name and the file name.</p>\n<p><img src="/pages/2/images/image00.png"></p>\n<p>When linking to a file in a sub folder you need to know the folder name. Because it possible to have more than one sub folder it is necessary to know the folder name.</p>\n<h3>Example</h3>\n<p><code class="language-text">&lt;a href=”subFolder/file2.html”&gt;link&lt;/a&gt;</code>\n<code class="language-text">&lt;img src=”subFolder/file2.gif” alt=””&gt;</code></p>\n<h2>Linking to a file in a parent folder</h2>\n<p>When linking to a file that is in a parent folder (up a directory) you need to indecate that you are going up a directory. This is done by adding a <code class="language-text">../</code> for every folder that you want to go up.</p>\n<p><img src="/pages/2/images/image02.png"></p>\n<h3>Example</h3>\n<p><code class="language-text">&lt;a href=”../file2.html”&gt;link&lt;/a&gt;</code>\n<code class="language-text">&lt;img src=”../file2.gif” alt=””&gt;</code></p>',frontmatter:{lesson:"Linking files",title:"Lesson 2",lessonId:2,downloads:null}},allMarkdownRemark:{edges:[{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/index.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Anchor Tag"},fields:{slug:"/2/index.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/inline.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Inline Elements"},fields:{slug:"/2/inline.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/folders.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Linking files"},fields:{slug:"/2/folders.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/images.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Images"},fields:{slug:"/2/images.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/image-types.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Image Types"},fields:{slug:"/2/image-types.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/embed.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Embedding Content"},fields:{slug:"/2/embed.html"}}},{node:{id:"/Users/dhahn/dev/html-class-g/src/pages/2/homework.md absPath of file >>> MarkdownRemark",frontmatter:{title:"Lesson 2",lesson:"Homework"},fields:{slug:"/2/homework.html"}}}]}},pathContext:{slug:"/2/folders.html",title:"Lesson 2"}}}});
